import React, { useEffect, useRef, useState } from 'react';
import { gsap } from 'gsap';

const Navbar = () => {
  const navRef = useRef(null);
  const logoRef = useRef(null);
  const [activeSection, setActiveSection] = useState('hero');
  const [isScrolled, setIsScrolled] = useState(false);

  const navItems = [
    { name: 'EVENTS', href: '#events', id: 'events' },
    { name: 'TEAM', href: '#about', id: 'about' },
    { name: 'CREATORS', href: '#gallery', id: 'gallery' },
    { name: 'SPONSORS', href: '#sponsors', id: 'sponsors' }
  ];

  useEffect(() => {
    const nav = navRef.current;
    const logo = logoRef.current;

    // Initial navbar animation - Much faster
    gsap.fromTo(nav, 
      { y: -100, opacity: 0 },
      { 
        y: 0, 
        opacity: 1, 
        duration: 0.4,
        ease: "power2.out",
        delay: 0.1
      }
    );

    // Logo hover animation setup
    const handleLogoHover = () => {
      gsap.to(logo, {
        scale: 1.1,
        duration: 0.3,
        ease: "power2.out"
      });
    };

    const handleLogoLeave = () => {
      gsap.to(logo, {
        scale: 1,
        duration: 0.3,
        ease: "power2.out"
      });
    };

    if (logo) {
      logo.addEventListener('mouseenter', handleLogoHover);
      logo.addEventListener('mouseleave', handleLogoLeave);
    }

    // Scroll detection
    const handleScroll = () => {
      const scrollY = window.scrollY;
      setIsScrolled(scrollY > 50);

      // Update active section based on scroll position
      const sections = ['hero', 'events', 'about', 'gallery', 'sponsors'];
      const currentSection = sections.find(section => {
        const element = document.querySelector(`#${section}`);
        if (element) {
          const rect = element.getBoundingClientRect();
          return rect.top <= 100 && rect.bottom >= 100;
        }
        return false;
      });

      if (currentSection) {
        setActiveSection(currentSection);
      }
    };

    window.addEventListener('scroll', handleScroll);

    return () => {
      if (logo) {
        logo.removeEventListener('mouseenter', handleLogoHover);
        logo.removeEventListener('mouseleave', handleLogoLeave);
      }
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const scrollToSection = (href, id) => {
    const element = document.querySelector(href);
    if (element) {
      element.scrollIntoView({ 
        behavior: 'smooth',
        block: 'start'
      });
      setActiveSection(id);
    }
  };

  return (
    <nav 
      ref={navRef}
      className={`fixed top-0 left-0 right-0 z-[9999] transition-all duration-500 ${
        isScrolled 
          ? 'bg-black/90 backdrop-blur-md border-b border-white/10' 
          : 'bg-black/60 backdrop-blur-sm'
      }`}
      style={{
        background: isScrolled 
          ? 'linear-gradient(135deg, rgba(0,0,0,0.95) 0%, rgba(26,26,26,0.9) 100%)'
          : 'linear-gradient(135deg, rgba(0,0,0,0.7) 0%, rgba(26,26,26,0.6) 100%)'
      }}
    >
      <div className="container mx-auto px-6 py-4">
        <div className="flex items-center justify-between">

          {/* Left Side - SAE Logo */}
          <div 
            ref={logoRef}
            className="cursor-pointer"
            onClick={() => scrollToSection('#hero', 'hero')}
          >
            <div className="flex items-center space-x-3">
              {/* SAE Badge */}
              <div className="relative">
                <div className="w-12 h-12 bg-gradient-to-br from-yellow-400 to-orange-500 rounded border-2 border-white/30 flex items-center justify-center relative overflow-hidden">
                  <span className="text-black font-black text-lg z-10"
                        style={{ fontFamily: 'Impact, Arial Black, sans-serif' }}>
                    SAE
                  </span>
                  {/* Animated background */}
                  <div className="absolute inset-0 bg-gradient-to-r from-transparent via-white/20 to-transparent animate-pulse"></div>
                </div>
                {/* Glow effect */}
                <div className="absolute inset-0 w-12 h-12 bg-yellow-400/30 rounded blur-md animate-pulse"></div>
              </div>

              {/* SAE Text */}
              <div>
                <h1 className="text-2xl font-black tracking-wider text-white"
                    style={{ 
                      fontFamily: 'Impact, Arial Black, sans-serif',
                      textShadow: '2px 2px 0px #000000, -1px -1px 0px #333333'
                    }}>
                  SAE
                </h1>
                <p className="text-xs text-gray-300 uppercase tracking-wider font-medium -mt-1"
                   style={{ fontFamily: 'Arial, sans-serif' }}>
                  AUTO EMPIRE
                </p>
              </div>
            </div>
          </div>

          {/* Right Side - Navigation Buttons */}
          <div className="flex items-center space-x-2">
            {navItems.map((item, index) => (
              <button
                key={item.id}
                onClick={() => scrollToSection(item.href, item.id)}
                className={`px-6 py-3 font-bold text-sm uppercase tracking-wider transition-all duration-300 border-2 relative group overflow-hidden ${
                  activeSection === item.id
                    ? 'bg-gradient-to-r from-blue-600 to-purple-600 text-white border-white/30 scale-105'
                    : 'bg-black/60 text-gray-300 border-white/20 hover:bg-white/10 hover:text-white hover:border-white/40 hover:scale-105'
                }`}
                style={{
                  fontFamily: 'Arial, sans-serif',
                  clipPath: 'polygon(8px 0%, 100% 0%, calc(100% - 8px) 100%, 0% 100%)',
                  textShadow: '1px 1px 2px rgba(0, 0, 0, 0.8)'
                }}
              >
                {/* Button background animation */}
                <div className="absolute inset-0 bg-gradient-to-r from-transparent via-white/5 to-transparent transform -translate-x-full group-hover:translate-x-full transition-transform duration-700"></div>

                {/* Button text */}
                <span className="relative z-10">{item.name}</span>

                {/* Active indicator */}
                {activeSection === item.id && (
                  <div className="absolute bottom-0 left-2 right-2 h-0.5 bg-white rounded-full"></div>
                )}
              </button>
            ))}

            {/* Contact CTA Button */}
            <button
              onClick={() => scrollToSection('#contact', 'contact')}
              className="ml-4 px-6 py-3 font-bold text-sm uppercase tracking-wider bg-gradient-to-r from-red-600 to-pink-600 hover:from-red-700 hover:to-pink-700 text-white border-2 border-red-400/50 hover:border-red-300/70 transition-all duration-300 hover:scale-105 relative group overflow-hidden"
              style={{
                fontFamily: 'Arial, sans-serif',
                clipPath: 'polygon(8px 0%, 100% 0%, calc(100% - 8px) 100%, 0% 100%)',
                textShadow: '1px 1px 2px rgba(0, 0, 0, 0.8)'
              }}
            >
              {/* Button shine effect */}
              <div className="absolute inset-0 bg-gradient-to-r from-transparent via-white/20 to-transparent transform -translate-x-full group-hover:translate-x-full transition-transform duration-500"></div>
              <span className="relative z-10">CONTACT HQ</span>
            </button>
          </div>
        </div>
      </div>

      {/* Bottom border with animated gradient */}
      <div className="absolute bottom-0 left-0 right-0 h-px bg-gradient-to-r from-transparent via-white/30 to-transparent"></div>

      {/* Animated scanline effect */}
      <div className="absolute bottom-0 left-0 h-px w-full bg-gradient-to-r from-transparent via-blue-400/60 to-transparent animate-pulse" 
           style={{ animationDuration: '3s' }}></div>
    </nav>
  );
};

export default Navbar;
